webpackJsonp([0x8493efcb13abc000],{"./node_modules/json-loader/index.js!./.cache/json/meta-free-code-camp-twitch-account.json":function(e,t){e.exports={data:{markdownRemark:{html:"<p>Twitch is a popular live streaming service that Free Code Camp moved away from</p>\n<p>As much as we enjoyed using this service, streams were few and far between and therefore it wasn’t serving it’s purpose.</p>\n<p>We have decided to move our focus onto using <a href='https://www.youtube.com/freecodecamp' target='_blank' rel='nofollow'>YouTube</a> for broadcasting our monthly summits and pair programming as well as uploading tutorials and hikes.</p>\n<p>You can find our YouTube chat room here: <a href='https://gitter.im/FreeCodeCamp/YouTube' target='_blank' rel='nofollow'>FreeCodeCamp/YouTube</a></p>\n<p>You can find the old twitch channel here: <a href='https://www.twitch.tv/freecodecamp' target='_blank' rel='nofollow'>twitch.tv/freecodecamp</a></p>\n<p><del>FreeCodeCamp uses Twitch.tv to broadcast live streams. This can be anything from live pair programming to our monthly Summit, where big news events and new developments are announced.</del></p>\n<p><del>All levels of coders are encouraged to stream on the FreeCodeCamp twitch channel. If this is something that would interest you, please contact the twitch mods on gitter.</del></p>",fields:{slug:"/meta/free-code-camp-twitch-account/"},frontmatter:{title:"Free Code Camp Twitch Account"}}},pathContext:{slug:"/meta/free-code-camp-twitch-account/"}}}});
